import {useEffect} from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';

import stripimg1 from "../media/strip1.png";
import stripimg2 from "../media/strip2.png";

export default function Strip() {
//  inting aos 
useEffect(() => {
  AOS.init();


}, [])

  return (
    <div className='strip' >
<img data-aos="fade-right" data-aos-duration="1000" src={stripimg1} alt="illustration" />
<img  data-aos="fade-left" data-aos-duration="1000" src={stripimg2} alt="illustration" />
    </div>
  )
}
